/* eslint-disable jsx-a11y/alt-text */
/* eslint-disable @next/next/no-img-element */
import { NextRequest, NextResponse } from 'next/server'
import { ImageResponse } from 'next/og'
import { DayEnum } from '#utils/day'

const daySrcMap: Record<DayEnum, string> = {
  [DayEnum.MONDAY]:
    'data:image/png;base64,',
  [DayEnum.TUESDAY]:
    'data:image/png;base64,',
  [DayEnum.WEDNESDAY]:
    'data:image/png;base64,',
  [DayEnum.THURSDAY]:
    'data:image/png;base64,',
  [DayEnum.FRIDAY]:
    'data:image/png;base64,',
}

const numberSrc = {
  '0': {
    src: 'data:image/png;base64,',
    width: 26,
    height: 36,
  },
  '1': {
    src: 'data:image/png;base64,',
    width: 15,
    height: 34,
  },
  '2': {
    src: 'data:image/png;base64,',
    width: 24,
    height: 35,
  },
  '3': {
    src: 'data:image/png;base64,',
    width: 26,
    height: 36,
  },
  '4': {
    src: 'data:image/png;base64,',
    width: 27,
    height: 34,
  },
  '5': {
    src: 'data:image/png;base64,',
    width: 25,
    height: 35,
  },
  '6': {
    src: 'data:image/png;base64,',
    width: 26,
    height: 36,
  },
  '7': {
    src: 'data:image/png;base64,',
    width: 24,
    height: 34,
  },
  '8': {
    src: 'data:image/png;base64,',
    width: 26,
    height: 36,
  },
  '9': {
    src: 'data:image/png;base64,',
    width: 26,
    height: 36,
  },
}

export async function GET(request: NextRequest) {
  const week = request.nextUrl.searchParams.get('week')
  const day = request.nextUrl.searchParams.get('day')
  if (!week || !day || !Object.keys(DayEnum).includes(day)) {
    return NextResponse.json('Bad Request', { status: 400 })
  }

  return new ImageResponse(
    (
      <div
        style={{
          width: 1280,
          height: 640,
          background: '#202020',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          flexDirection: 'column',
          gap: 16,
        }}
      >
        <img
          alt="스파르타 로고"
          src="data:image/png;base64,"
          width={250}
          height={134}
        />
        <img
          alt="Today I Learned"
          src="data:image/png;base64,"
          width={717}
          height={88}
        />
        <div
          style={{
            display: 'flex',
            marginTop: 10,
            alignItems: 'center',
          }}
        >
          <img
            alt="내일배움캠프 Spring "
            width={397}
            height={50}
            src="data:image/png;base64,"
            style={{ marginRight: 16 }}
          />
          <div
            style={{
              display: 'flex',
              gap: 4,
              alignItems: 'center',
              marginRight: 4,
            }}
          >
            {week.split('').map((v, index) => (
              <img
                alt="week"
                key={index}
                src={numberSrc[v as keyof typeof numberSrc].src}
                width={numberSrc[v as keyof typeof numberSrc].width}
                height={numberSrc[v as keyof typeof numberSrc].height}
              />
            ))}
          </div>
          <img
            alt="주차 "
            src="data:image/png;base64,"
            width={82}
            height={43}
            style={{ marginRight: 16 }}
          />
          <img
            alt="요일"
            src={daySrcMap[day as keyof typeof DayEnum]}
            width={121}
            height={43}
          />
        </div>
      </div>
    ),
    {
      width: 1280,
      height: 640,
      status: 200,
    },
  )
}
